name: cachedTime
in: query
required: false
description: Time interval in which the file was cached
schema:
  title: CachedTimeInterval
  type: object
  properties:
    cachedTimeFrom:
      type: integer
      format: int64
      nullable: true
      default: null
      minimum: 0
      description: UNIX timestamp (UTC) of the interval start
    cachedTimeTo:
      type: integer
      format: int64
      nullable: true
      default: null
      minimum: 0
      description: UNIX timestamp (UTC) of the interval end
